// src/components/Header.js
import React from 'react';
//import { Navbar, Nav, Button } from 'react-bootstrap';
import { FaShoppingCart } from 'react-icons/fa';
import '../css/navbar'; // Custom styling for branding consistency

const Navbar = ({ setPage }) => (
  <Navbar bg="light" expand="lg" className="custom-navbar">
    <Navbar.Brand href="#" className="brand-logo">Bakery Delights</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="ml-auto">
        <Nav.Link onClick={() => setPage('home')} className="nav-link">Home</Nav.Link>
        <Nav.Link onClick={() => setPage('menu')} className="nav-link">Menu</Nav.Link>
        <Nav.Link onClick={() => setPage('order')} className="nav-link">Order</Nav.Link>
        <Nav.Link onClick={() => setPage('about')} className="nav-link">About Us</Nav.Link>
        <Nav.Link onClick={() => setPage('contact')} className="nav-link">Contact</Nav.Link>
      </Nav>
      <Button variant="outline-primary" className="order-button">
        <FaShoppingCart /> Order Now
      </Button>
    </Navbar.Collapse>
  </Navbar>
);

export default Navbar;
